import React from "react";

function Footer() {
  return (
    <footer>
      <div className="icons">
        <i class="fab fa-vimeo-v"></i>
        <i class="fab fa-youtube"></i>
      </div>

      <p>hello@yay.com</p>
      <p>copyright 2020</p>
    </footer>
  );
}

export default Footer;
